import React, { useState, useContext } from "react";

type PathsType = {
  path: string;
  name: string;
  button?: boolean;
  action?: Function;
  detail?: string;
};

type aboutUsData = {
  path: string;
  name: string;
  iconData: Function;
};

const initialValues: {
  path: string;
  videoId?: string;
  fetchLive: boolean;
  isSticky: boolean;
  live: boolean;
  drawerView: boolean;
  about: boolean;
  aboutUs: aboutUsData[];
  paths: PathsType[];
  updateNavBar: Function;
  updateAbout: Function;
  updateDrawerView: Function;
  updateIsSticky: Function;
  updateLive: Function;
  updateFetchLive: Function;
  updateVideoId: Function;
} = {
  path: "",
  videoId: "",
  fetchLive: true,
  live: false,
  isSticky: true,
  drawerView: false,
  about: false,
  aboutUs: [],
  paths: [],
  updateNavBar: () => { },
  updateDrawerView: () => { },
  updateIsSticky: () => { },
  updateAbout: () => { },
  updateLive: () => { },
  updateFetchLive: () => { },
  updateVideoId: () => { },
};

const NavBarContext = React.createContext(initialValues);

const useNavBar = () => useContext(NavBarContext);

const NavBarProvider: React.FC = ({ children }) => {
  const [path, setPath] = useState<string>("/");
  const [videoId, setVideoId] = useState<string>();
  const [live, setLive] = useState<boolean>(false);
  const [fetchLive, setFetchLive] = useState<boolean>(true);
  const [isSticky, setIsSticky] = useState<boolean>(true);
  const [about, setAbout] = useState<boolean>(true);
  const [drawerView, setDrawerView] = useState<boolean>(false);
  const [paths, setPaths] = useState<PathsType[]>([
    {
      path: "/",
      name: process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "HOME" : "ዋና ገጽ",
    },
    {
      path: "/ministry",
      name:
        process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "MINISTRIES" : "አገልግሎቶች",
    },
    {
      path: "/articles",
      name: process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "ARTICLES" : "መጣጥፎች",
    },
    {
      path: "/sermon",
      name: process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "SERMONS" : "ስብከቶች",
    },
    {
      path: "/about-us",
      name: process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "ABOUT US" : "ስለ እኛ",
    },
    {
      path: "/support-us",
      name:
        process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "SUPPORT US" : "አብረን እንስራ",
    },
    {
      path: "/support us",
      name: process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "LIVE" : "ቀትታ",
      button: true,
      action: () => { },
    },
  ]);
  const [aboutUs] = useState<aboutUsData[]>([
    {
      name:
        process.env.NEXT_PUBLIC_LANGUAGE === "en"
          ? "Small Group"
          : "የመጽሐፍ ቅዱስ ጥናት ቡድኖች",
      path: "/smallGroup",
      iconData: SmallGroupIcon,
    },
    {
      name: process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "Children" : "ሕፃናት",
      path: "/children",
      iconData: childrenIcon,
    },
    {
      name:
        process.env.NEXT_PUBLIC_LANGUAGE === "en"
          ? "Mission and Church planting"
          : "ሚስዮን እና የቤተክርስቲያን ተከላ",
      path: "/missionAndChurchPlanting",
      iconData: ChurchIcon,
    },
    {
      name:
        process.env.NEXT_PUBLIC_LANGUAGE === "en"
          ? "Marriage and family"
          : "ጋብቻ እና ቤተሰብ",
      path: "/marriageAndFamily",
      iconData: familyIcon,
    },
    {
      name: process.env.NEXT_PUBLIC_LANGUAGE === "en" ? "Youth" : "ወጣቶች",
      path: "/youth",
      iconData: youthIcon,
    },
    {
      name:
        process.env.NEXT_PUBLIC_LANGUAGE === "en"
          ? "Community outreach"
          : "የማህበረሰብ ተሳትፎዎች",
      path: "/communityOutreach",
      iconData: CommunityOutReach,
    },
  ]);
  const updateNavBar = (data: string) => {
    setPath(data);
  };

  const updateIsSticky = (data: boolean) => {
    setIsSticky(data);
  };

  const updateDrawerView = () => {
    setDrawerView(!drawerView);
  };
  const updateAbout = () => {
    setAbout(!about);
  };

  const updateLive = (status: boolean) => {
    setLive(status);
  };
  const updateFetchLive = (status: boolean) => {
    setFetchLive(status);
  };
  const updateVideoId = (status: string) => {
    setVideoId(status);
  };
  return (
    <NavBarContext.Provider
      value={{
        videoId,
        fetchLive,
        live,
        aboutUs,
        about,
        path,
        paths,
        isSticky,
        drawerView,
        updateAbout,
        updateNavBar,
        updateDrawerView,
        updateIsSticky,
        updateLive,
        updateFetchLive,
        updateVideoId,
      }}
    >
      {children}
    </NavBarContext.Provider>
  );
};

